import{_ as e,c as a,o as t,a4 as n}from"./chunks/framework.B2EPA2lv.js";const v=JSON.parse('{"title":"Octave Plugin","description":"","frontmatter":{},"headers":[],"relativePath":"guide/plugin_octave.md","filePath":"guide/plugin_octave.md","lastUpdated":1713151243000}'),i={name:"guide/plugin_octave.md"},o=n('<h1 id="octave-plugin" tabindex="-1">Octave Plugin <a class="header-anchor" href="#octave-plugin" aria-label="Permalink to &quot;Octave Plugin&quot;">​</a></h1><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>The Octave plugin relies on the <a href="./plugin_binary_gs.html">Ghostscript Binary Plugin</a>. Please install Ghostscript according to the documentation first and then check <code>Help -&gt; Plugins -&gt; Octave</code> to ensure that the plots in the documentation can be rendered correctly.</p><h3 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h3><p>Go to the <a href="https://octave.org" target="_blank" rel="noreferrer">Octave official website</a>, download and install Octave 5.2.0.</p><p>For example, download the Octave 5.2.0 installation package provided by the USTC open source software mirror:</p><ul><li><a href="http://mirrors.ustc.edu.cn/gnu/octave/windows/octave-5.2.0_1-w64-installer.exe" target="_blank" rel="noreferrer">http://mirrors.ustc.edu.cn/gnu/octave/windows/octave-5.2.0_1-w64-installer.exe</a></li><li><a href="http://mirrors.ustc.edu.cn/gnu/octave/windows/octave-5.2.0_1-w64-installer.exe.sig" target="_blank" rel="noreferrer">http://mirrors.ustc.edu.cn/gnu/octave/windows/octave-5.2.0_1-w64-installer.exe.sig</a></li></ul><h3 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>brew install octave</span></span></code></pre></div><h3 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h3><p>On Debian and its derivatives, use the following command to install:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>sudo apt install octave</span></span></code></pre></div><h2 id="tips" tabindex="-1">Tips <a class="header-anchor" href="#tips" aria-label="Permalink to &quot;Tips&quot;">​</a></h2><ol><li>Windows: The plotting functionality of Octave versions 6.x and above does not work properly in Mogan. <ul><li>We will work on making Mogan compatible with the new versions of Octave in the future, and contributions from the community are welcome.</li></ul></li><li>Ubuntu: Octave installed using snap cannot be used normally in Mogan. <ul><li>This is due to the mechanism of snap, so it is not recommended to install Octave using snap.</li></ul></li></ol><h2 id="documentation-please-check-help-plugins-octave" tabindex="-1">Documentation: Please check <code>Help -&gt; Plugins -&gt; Octave</code> <a class="header-anchor" href="#documentation-please-check-help-plugins-octave" aria-label="Permalink to &quot;Documentation: Please check `Help -&gt; Plugins -&gt; Octave`&quot;">​</a></h2>',15),l=[o];function s(c,r,d,h,u,p){return t(),a("div",null,l)}const m=e(i,[["render",s]]);export{v as __pageData,m as default};
